import React from 'react';

const CartColumns=(props)=>{
    return (
        <div className="container-fluid text-center d-none d-lg-block">
            <div className="row">
                <div className="col-10 col-lg-2 mx-auto">
                    <p>Product</p>
                </div>
            </div>
        </div>
    );
}

export default CartColumns;
